import React, { useEffect, useState } from "react";
import axios from "axios";
import AdminNavbar from "../../components/AdminNavbar";
import Loader from "../../components/Loader";
import { useNavigate } from "react-router-dom";

const InstructorList = () => {
  const [instructors, setInstructors] = useState([]);
  const [loading, setLoading] = useState(true);
  const [message, setMessage] = useState("");
  const navigate = useNavigate();

  const fetchInstructors = async () => {
    try {
      const token = localStorage.getItem("adminToken");
      if (!token) {
        navigate("/admin/login");
        return;
      }

      const response = await axios.get("http://localhost:5000/api/instructor", {
        headers: { Authorization: `Bearer ${token}` },
      });

      setInstructors(response.data || []);
      setMessage("");
    } catch (error) {
      setMessage("Failed to load instructors.");
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchInstructors();
  }, []);

  const handleDelete = async (id) => {
    console.log("Attempting to delete:", id); // DEBUG

    if (!window.confirm("Are you sure you want to delete this instructor?"))
      return;

    try {
      const token = localStorage.getItem("adminToken");

      const res = await axios.delete(
        `http://localhost:5000/api/instructor/${id}`,
        {
          headers: { Authorization: `Bearer ${token}` },
        }
      );

      console.log("Delete response:", res.data); // DEBUG

      setInstructors((prev) => prev.filter((inst) => inst._id !== id));
      setMessage("Instructor deleted successfully!");
    } catch (error) {
      console.error("Delete error:", error.response?.data); // DEBUG
      setMessage("Failed to delete instructor.");
    }
  };

  return (
    <div>
      <AdminNavbar />

      <div className="container mx-auto mt-10 px-4">
        <h2 className="text-3xl font-bold text-gray-800 mb-4 border-b-4 border-green-600 inline-block pb-2">
          Instructor List
        </h2>

        {message && (
          <p
            className={`mb-4 p-2 text-center rounded ${
              message.includes("success")
                ? "bg-green-100 text-green-700"
                : "bg-red-100 text-red-700"
            }`}
          >
            {message}
          </p>
        )}

        {loading ? (
          <Loader />
        ) : (
          <div className="overflow-x-auto shadow-lg rounded-lg border border-gray-200">
            <table className="min-w-full bg-white divide-y divide-gray-200">
              <thead className="bg-green-700 text-white">
                <tr>
                  <th className="px-6 py-3 text-left text-sm font-semibold uppercase tracking-wider">
                    Name
                  </th>
                  <th className="px-6 py-3 text-left text-sm font-semibold uppercase tracking-wider">
                    Email
                  </th>
                  <th className="px-6 py-3 text-left text-sm font-semibold uppercase tracking-wider">
                    Phone
                  </th>
                  <th className="px-6 py-3 text-left text-sm font-semibold uppercase tracking-wider">
                    Department
                  </th>
                  <th className="px-6 py-3 text-center text-sm font-semibold uppercase tracking-wider">
                    Actions
                  </th>
                </tr>
              </thead>

              <tbody className="divide-y divide-gray-200">
                {instructors.length === 0 ? (
                  <tr>
                    <td colSpan="5" className="text-center py-6 text-gray-500">
                      No instructors found
                    </td>
                  </tr>
                ) : (
                  instructors.map((inst, index) => (
                    <tr
                      key={inst._id}
                      className={index % 2 === 0 ? "bg-gray-50" : "bg-white"}
                    >
                      <td className="px-6 py-4 whitespace-nowrap text-gray-800 font-medium">
                        {inst.name}
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap text-gray-700">
                        {inst.email}
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap text-gray-700">
                        {inst.phone}
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap text-gray-700">
                        {inst.department}
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap text-center">
                        <button
                          className="bg-red-500 hover:bg-red-600 text-white px-3 py-1 rounded shadow-md transition duration-200"
                          onClick={() => handleDelete(inst._id)}
                        >
                          Delete
                        </button>
                      </td>
                    </tr>
                  ))
                )}
              </tbody>
            </table>
          </div>
        )}
      </div>
    </div>
  );
};

export default InstructorList;
